package kh.java.func;

public class TestClass2 {
	private String str;
	private int num;
	public TestClass2() {
		super();
		// TODO Auto-generated constructor stub
	}
	public TestClass2(String str, int num) {
		super();
		this.str = str;
		this.num = num;
	}
	public String getStr() {
		return str;
	}
	public void setStr(String str) {
		this.str = str;
	}
	public int getNum() {
		return num;
	}
	public void setNum(int num) {
		this.num = num;
	}
	@Override
	public String toString() {
		return "TestClass2 [str=" + str + ", num=" + num + "]";
	}
	
}
